import React, { useContext } from "react";
import {
  Button,
  TextField,
  Link,
  Paper,
  Box,
  Grid,
  Typography,
  makeStyles,
} from "@material-ui/core";

import { useHistory } from "react-router-dom";

import "./login.scss";

import { useApiRequest, useSimpleForm } from "../../../hooks";
import { UserContext } from "../../../context";

function Copyright() {
  return (
    <Typography variant="body2" color="textSecondary" align="center">
      {"Copyright © "}
      <Link color="inherit" href="https://material-ui.com/">
        Hera's technology
      </Link>{" "}
      {new Date().getFullYear()}
      {"."}
    </Typography>
  );
}

const useStyles = makeStyles((theme) => ({
  image: {
    backgroundImage: "url(https://source.unsplash.com/random)",
    backgroundRepeat: "no-repeat",
    backgroundColor:
      theme.palette.type === "light"
        ? theme.palette.grey[50]
        : theme.palette.grey[900],
    backgroundSize: "cover",
    backgroundPosition: "center",
  },
  paper: {
    margin: theme.spacing(8, 4),
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
  },
  logoBig: {
    marginTop: 22,
    marginBottom: 90,
    backgroundColor: "#DEDEDE",
    color: "#FFFFFF",
  },
  forgot: {
    color: "#F2836B",
    marginLeft: 180,
  },
  form: {
    //width: '100%',
    marginTop: theme.spacing(1),
  },
  loginButton: {
    backgroundColor: "#4E5674",
    width: 100,
    height: 50,
  },
  noTienes: {
    marginTop: 15,
    marginRight: 85,
  },
  noTienesText: {
    color: "#F2836B",
  },
}));

const initialFormValue = { email: "", password: "" };

export const SignInSide = () => {
  const classes = useStyles();
  const history = useHistory();
  const { postRequest } = useApiRequest();
  const { setUserData } = useContext(UserContext);
  const { values, onChange } = useSimpleForm(initialFormValue);

  const handleLogin = (e) => {
    e.preventDefault();
    postRequest("user/auth", values)
      .then((userData) => {
        setUserData(userData);
        history.push("/");
      })
      .catch((err) => {
        console.log("There was an error", err);
      });
  };

  return (
    <Grid container component="main" className="login-screen-container">
      <Grid item xs={false} sm={4} md={7} className={classes.image} />
      <Grid item xs={12} sm={8} md={5} component={Paper} elevation={6} square>
        <div className={classes.paper}>
          <Button variant="contained" className={classes.logoBig}>
            Logo
          </Button>
          <TextField
            variant="outlined"
            margin="normal"
            required
            id="email"
            label="Usuario"
            name="email"
            autoComplete="email"
            className="field"
            value={values.email}
            onChange={onChange}
          />
          <TextField
            variant="outlined"
            margin="normal"
            required
            name="password"
            label="Contraseña"
            type="password"
            id="password"
            autoComplete="current-password"
            className="field"
            value={values.password}
            onChange={onChange}
          />
          <Link href="#" variant="body2" className={classes.forgot}>
            ¿Olvidaste tu contraseña?
          </Link>
          <div className="login">
            <Button
              type="submit"
              variant="contained"
              color="primary"
              className={classes.loginButton}
              onClick={handleLogin}
            >
              LOGIN
            </Button>
          </div>
          <Grid container>
            <Grid item xs></Grid>
            <Grid item className={classes.noTienes}>
              <Link href="#" variant="body2" className={classes.noTienesText}>
                {"¿No tienes cuenta? Sign Up"}
              </Link>
            </Grid>
          </Grid>
          <Box mt={5}>
            <Copyright />
          </Box>
        </div>
      </Grid>
    </Grid>
  );
};
